import { v4 as uuidv4 } from "uuid";
import { slider1, slider2, slider3 } from './imports'

const dataSlider = [
  {
    id: uuidv4(),
    title: "Lorem ipsum",
    subTitle: "Lorem",
    sliderImage: slider1
  },
  {
    id: uuidv4(),
    title: "Lorem ipsum",
    subTitle: "Lorem",
    sliderImage: slider2
  },
  {
    id: uuidv4(),
    title: "Lorem ipsum",
    subTitle: "Lorem",
    sliderImage: slider3
  }
];

export default dataSlider;
